import React from 'react'
import {Text} from 'react-native'
import FontAwesome5 from 'react-native-vector-icons/FontAwesome5'
import { Button, View } from 'react-native'
import { createNativeStackNavigator } from '@react-navigation/native-stack';
import {createBottomTabNavigator} from '@react-navigation/bottom-tabs'
import { createDrawerNavigator } from '@react-navigation/drawer'

const Link = createNativeStackNavigator()
const Tab = createBottomTabNavigator()
const Drawer = createDrawerNavigator()

const Drawers = () => {
  return(
    <Drawer.Navigator screenOptions={({route}) => ({
        headerShown:false,
        tabBarIcon:() => {
            let icon
            if(route.name === 'Command'){
                icon = 'utensils'
            }
            return (<FontAwesome5 name='utensils' color='#000' solid />)
        }
      })}>
          <Drawer.Screen name="command" component={Command}/>
    </Drawer.Navigator>
  )
}
const Command = () => {
  return(
    <Tab.Navigator screenOptions={
      ({route}) => ({
        headerShown:false,
        tabBarIcon:() => {
          let icon
          if(route.name === 'Command'){
            icon = 'utensils'
          }
          return (<FontAwesome5 name='utensils' color='#000' solid />)
      }

      })
    }>
      <Tab.Screen name="command" component={Command}/>
    </Tab.Navigator>
  )
}

const Root = () => {
  return(
    <Link.Navigator>
      <Link.Screen name="Drawer" component={Drawers} />
      <Link.Screen name="Command" component={Command} />
    </Link.Navigator>
  )
}

export default Root
